const TextAreaField = () => {
  return (
    <div class="mb-4">
      <label for="exampleFormControlTextarea1" class="form-label">
        Example textarea
      </label>
      <textarea
        className="form-control"
        id="exampleFormControlTextarea1"
        rows="3"
      ></textarea>
    </div>
  );
};

export default TextAreaField;
